import React from 'react';
import '../styles/HomePage.css';
import Main from '../sections/Main'; // Main bileşeni
import About from '../sections/About'; // About bileşeni
import Contact from '../sections/Contact'; // Contact bileşeni

const HomePage = () => {
  return (
    <div className="home-container">
      <Main id="main" /> {/* Ana sayfa */}
      <About id="about" /> {/* Hakkımızda */}
      <Contact id="contact" /> {/* İletişim */}
    </div>
  );
};

export default HomePage;
